summary.label:
Plot Digitizer is an app to extract numerical data from plot images.

It is often necessary to obtain original (x, y) data from graphs, e.g. from scanned scientific plots, when data values are not available. Plot Digitizer allows you to easily get the numbers in such cases. 

Digitizing is a nine-step process:

1. Open a picture or take a photo of the plot;
2. Crop the picture to isolate the plot;
3. Align the plot, if required;
4. Do some fine-tuning cropping, if required;
5. Set the X and Y axes anchor points using your finger or an Apple Pencil;
6. Adjust the Axes Titles and anchor points;
7. Digitize the data series using your finger or an Apple Pencil;
8. Label the data series;
9. View, export the digitized data or view fitted equations.

At the end of the process, you can copy the data to the clipboard, share it with another app, view a digital plot or fitted equations from the digitized data.

